import React, { useState, useEffect } from "react";
import { useNavigate } from 'react-router-dom';
import Manager_Product_List from "./Manager_Product_List";
import Manager_Add_Product from "./Manager_Add_Product";
import Manager_Orderding_List from "./Manager_Orderding_List";
import Manager_Profits from "./Manager_Profits";
import { Link, Outlet } from "react-router-dom"

export default function My_Manager(props) {
    const [mystyle, setMystyle] = useState({});
    useEffect(() => {
        setMystyle({
            color: "#3aedff",
            fontSize: "20px", marginLeft: "330px",
            marginTop: "70PX"
        });
    }, []);
    return (
    <div>
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/bootstrap@4.5.3/dist/css/bootstrap.min.css" integrity="sha384-TX8t27EcRE3e/ihU7zmQxVncDAy5uIKz4rEkgIXeMed4M0jlfIDPvg6uqKI2xXr2" crossorigin="anonymous"></link>
        
        {/* <div className="navbar navbar-expand-md">
            <nav id="navs">
                <Link className="link" style={mystyle} to={`/manager/productlist`}>productlist</Link>
                <Link className="link" style={mystyle} to={`/manager/addProduct`}>addProduct</Link>
                <Link className="link" style={mystyle} to={`orderingList`}>orderingList</Link>
                <Link className="link" style={mystyle} to={`profits`}>profits</Link>
            </nav>
            <Outlet />
        </div> */}
        <nav class="navbar navbar-expand-md">
            <a class="navbar-brand" href="#">Logo</a>
            <button class="navbar-toggler navbar-dark" type="button" data-toggle="collapse" data-target="#main-navigation">
                <span class="navbar-toggler-icon"></span>
            </button>
            <div class="collapse navbar-collapse" id="main-navigation">
                <ul class="navbar-nav">
                    <li class="nav-item">
                        <a class="nav-link" href="#">Home</a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link" href="#">About</a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link" href="#">Contact</a>
                    </li>
                </ul>
            </div>
        </nav>
    </div>);
}
